import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import UploadImages from "./components/upload";
import ImageAnnotation from "./components/imageannotation";
import ImageTable from "./components/list";
import ModelsTable from './components/modellist';
import RuleCreationPage from "./components/createrule";
import Layout from './components/Layout';
import TableComponent from './components/viewrules';
import DeploymentTable from './components/viewdeploy';

const PrivateRoute = ({ element: Component, ...rest }) => {
  const [isValidUser, setIsValidUser] = useState(false);

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    // Add your authentication logic here to check if the userEmail is valid
    setIsValidUser(userEmail !== null && userEmail !== '');
    console.log(userEmail);
    console.log(isValidUser);
  }, []);

  return (
    <Route
      {...rest}
      render={(props) =>
        isValidUser ? <Component {...props} /> : <Navigate to="/login" replace />
      }
    />
  );
};

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="login" element={<Login />} />
        <Route path="register" element={<Register />} />

        <PrivateRoute path="/" element={<Layout />} />
        <PrivateRoute path="/imageannotation/:requestID" element={<ImageAnnotation />} />
        <PrivateRoute path="/dataset/view" element={<ImageTable />} />
        <PrivateRoute path="/dataset/upload" element={<UploadImages />} />
        <PrivateRoute path="/model/view" element={<ModelsTable />} />
        <PrivateRoute path="/model/train" element={<ImageTable />} />
        <PrivateRoute path="/rules/create" element={<RuleCreationPage />} />
        <PrivateRoute path="/rules/view" element={<TableComponent />} />
        <PrivateRoute path="/deploy" element={<DeploymentTable />} />
      </Routes>
    </Router>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
